import React from 'react';
import NotesList from './Components/Note/notesList';

function App() {
  return (
    <div className="p-8 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-6">Moje Notatki</h1>
      <NotesList />
    </div>
  );
}

export default App;
